//Carter S. Jun 2020
//Rain Drops on a pond
//Using Schreck ripples (Fundamental solutions for water surface waves SIGGRAPH 2019)


//Channel 2 is used for pond sand and also to break up the surface of the pond
//Buffer C contains ripple height map (used as a normal map here (im on a deadline be nice ;( ))

//Cubic smooth minimum union function from user TinyTexel
float sminCubic( float a, float b, float k )
{
    float h = max( k-abs(a-b), 0.0 )/k;
    return min( a, b ) - h*h*h*k*(1.0/6.0);
}

//distance to plane
float sdPlane( vec3 p, vec4 n )
{
  return dot(p,n.xyz) + n.w;
}

//Plane but with pebble heightmap
float sdTerrain(vec3 p, vec4 n)
{
	float to_plane = sdPlane(p,n);
    float to_pebble = texture(iChannel1,p.xz).x*0.2;//play with pebble max height
    return to_plane - to_pebble;
}

//This function grows with more objects and operations (unions, distortions, perturbations, ect)
//This is usually where acceleration structures and ad hoc hackery goes down
//x  index is distance, y index is material type (sometimes other meta info)
vec2 map_the_world(in vec3 p)
{

	//Plane is represented as a vec4 using ax+by+cz+w = 0 formulation
    float to_ground = sdPlane(p, normalize(vec4(0.0,1.0,0.0,0.3)));
    float to_rock = sdTerrain(p, normalize(vec4(0.0,1.0,0.0,0.3)));
    float to_water = abs(sdPlane(p, normalize(vec4(0.0,1.0,0.0,0.0))));
    if (to_water < to_rock) {//early quit since we expect to be closest to water often
        return vec2(to_water,2.0);
    }
    //Rocks at the bottom of the pond
    float pebble_start = 0.45;//play with this range(0.0,1.0)
    float mat = 0.0;
    float height = texture(iChannel1, p.xz*0.15).x;
    if (height > pebble_start){//using pebbles to decide where pebbles are lol (play with numbers)
        //change mat
        float prop = height-pebble_start;
        //nonlinear interp between ground and rocks to make sure it looks like they touch (rocks dont get cut off) 
        to_ground = mix(to_ground,to_rock,1.0 - (1.0/pow(prop+1.0,8.0)));
    	mat = 1.0;
    }

    return vec2(to_ground,mat);
}


//Find the normal of the surface at this point P
vec3 calculate_normal( in vec3 pos)
{
    vec2 e = vec2(1.0,-1.0)*0.5773;
    const float eps = 0.0005;
    return normalize( e.xyy*map_the_world( pos + e.xyy ).x + 
					  e.yyx*map_the_world( pos + e.yyx ).x + 
					  e.yxy*map_the_world( pos + e.yxy ).x + 
					  e.xxx*map_the_world( pos + e.xxx ).x );  
}

vec2 march_ray(vec3 ray_origin, vec3 ray_direction, float tmax) {
	float t = 0.0;//current depth
    float m = 0.0;
    for( int i=0; i<256; i++ )
    {
        vec3 pos = ray_origin + t*ray_direction;
        //get dist to nearest surface
        vec2 h = map_the_world(pos);
        m = h.y;
        //if we hit something break
        if( h.x<0.0001 || t>tmax ) return vec2(t,m);
        //step forward
        t += h.x;
    }
    return vec2(t,m);
}


void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    // camera movement	
	float an = 0.5*(iTime-10.0);
	vec3 ray_origin = vec3( 1.0*cos(an), 0.4, 1.0*sin(an) );
    vec3 origin = vec3( 0.0, 0.0, 0.0 );
    // camera matrix (for ease of animation)
    vec3 ww = normalize( origin - ray_origin );
    vec3 uu = normalize( cross(ww,vec3(0.0,1.0,0.0) ) );
    vec3 vv = normalize( cross(uu,ww));


    //initialize color
    vec3 total = vec3(0.0);

 	//what pixel are we marching through
    vec2 p = (-iResolution.xy + 2.0*fragCoord)/iResolution.y;


	// create view ray
    vec3 ray_direction = normalize( p.x*uu + p.y*vv + 1.5*ww );


    // raymarch
    const float tmax = 4.0; //max march depth
    vec2 res = march_ray(ray_origin,ray_direction,tmax);
    float t = res.x;

     // ambient + diffuse light color calculations
     vec3 color = vec3(0.0);
     if( t<tmax )
     {//we hit something
        vec3 pos = ray_origin + t*ray_direction;
        //break up the surface normal
        vec3 normal = calculate_normal(pos) + vec3(0.2*texture(iChannel2,1.0*pos.xz)) + vec3(texture(iChannel3,vec2(0.5,1.0)*0.3*pos.xz + vec2(0.5,0.5)));//play with values make sure to index ripple height map within bounds
        //get the refracted ray direction
        vec3 ref_dir = refract(ray_direction, normal, 1.0/1.33);
        vec3 refract_color = vec3(0.0);
        vec3 water_color = vec3(0.0,0.3,0.4);
        vec3 reflect_color = pow(texture(iChannel0, reflect(ray_direction, normal)).rbg, vec3(2.2));
        res = march_ray(pos + ref_dir*0.001, ref_dir, tmax);
        t = res.x;
        float m = res.y;

        if( t<tmax )
     	{
            pos = (pos + ref_dir*0.001) + t*ref_dir;

        	if(m < 1.0) {//is dirt area
             	refract_color = texture(iChannel2, pos.xz*1.0).rgb;
        	}else{//is rock area
            	float rock_val = texture(iChannel1,pos.xz).x;
            	if (rock_val <0.25){//get some dirt in between rocks (play with this value)
             		refract_color =  texture(iChannel2, pos.xz*1.0).rgb;
            	}else{
                    //rock color (grey whoda thunk it)
         			refract_color = vec3(0.8*rock_val);
            	}
        	}
        }else{
        	refract_color = pow(texture(iChannel0, ref_dir).rgb, vec3(2.2));
        }
        //combine all effects
        color = refract_color*0.4 + water_color*0.3 + reflect_color*0.25;//play with the combo
     }else{//missed pond hit background
     	color = pow(texture(iChannel0, ray_direction).rgb, vec3(2.2));
     }

     // gamma color calculation    
     color = sqrt( color );
	 total += color;

	 fragColor = vec4( total, 1.0 );
}

//By Carter Slocum 2020

//can be first or second shader in pipeline
//pseudo-randomly spawn ripples and update their center, time, and active state.

#define MAX_WAVE_TIME 10.0

//used to randomly select center
vec2 hash2( vec2 p )
{
    return fract(sin(vec2(dot(p,vec2(127.1,311.7)),dot(p,vec2(269.5,183.3))))*43758.5453);
}


void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    if (iFrame == 0)
    {//init ripples
    	if (fragCoord.y < 0.99 && fragCoord.x < 9.99)
        {//Initialize ripples
            vec2 cent = hash2(fragCoord);
        	fragColor = vec4(cent.x,cent.y, fragCoord.x, 1.0);
        }
        else
        {
        	fragColor = vec4(0.0,0.0,0.0,0.0);
        }
    }
    else
    {//update ripples
    	vec4 last_ripple = texelFetch(iChannel0, ivec2(int(fragCoord.x),int(fragCoord.y)),0);

        if(last_ripple.a > 0.0)
        {//Update ripples
        	float wave_time = last_ripple.b;
            wave_time += iTimeDelta;
            if (wave_time > MAX_WAVE_TIME)
            {
            	vec2 cent = hash2(last_ripple.rg);
                last_ripple = vec4(cent.x,cent.y,wave_time - MAX_WAVE_TIME,1.0);
            }
            else
            {
                last_ripple.b = wave_time;
            }
        }

        fragColor = last_ripple;
    }
}

//By Carter Slocum based on Schreck et al SIGGRAPH 2019

//Note that most any change to these values requires the values of k0 and k1 to be recomputed
//used as second to last shader (dependant on ripple data and k data)

#define PI 3.14159265359 
//density
#define rho 1000.0 
#define tau_star 0.074
//gravity
#define GRAV 9.8
//initial ripple size
#define R_star 0.002
//viscosity
#define V_star 0.000001

//range of wave number values. no real solution to V exists less than V(K_MID)
#define K_MIN 0.0000024999
#define K_MAX 2354.35442935
#define K_MID 0.2863

//MIN V and maximum V for precomputed K samples
#define V_MIN 1.27326851
#define V_MAX 100.0


#define SAMPLES 2048.0


//these conversion are all over the code since we are in polar coords.
float tau = tau_star / (rho * GRAV * R_star *R_star);


//this function is only necessary if you plan to use newtons method instead of precomputing ks
float V(float k)
{
    float tau = tau_star / (rho * GRAV * R_star *R_star);
    return (1.0 + 3.0*tau*k*k) / (2.0 * sqrt(k*(1.0 + tau * k*k)));
}

//derivative of V
float dV(float k)
{
    float ksq = k*k;
    float tmp = tau*ksq*k + k;
    return (3.0*tau*ksq*(tau*ksq + 2.0) - 1.0) / (4.0 * sqrt(tmp*tmp*tmp));
}

//look up pre-computed ks
vec2 WaveNumbers(float target)
{
   float tg = (target - V_MIN)/(V_MAX - V_MIN)*SAMPLES;
   int ind = int(tg);
   vec4 samp0 = texelFetch(iChannel0,ivec2(ind % int(iChannelResolution[0]),ind/int(iChannelResolution[0])),0);
   ind += 1;
   vec4 samp1 = texelFetch(iChannel0,ivec2(ind % int(iChannelResolution[0]),ind/int(iChannelResolution[0])),0);
   float frac = mod(tg, 1.0);
   return vec2(mix(samp0.x,samp1.x,frac),mix(samp0.y,samp1.y,frac));
}

//given wave number get angular frequency
float omega(float k)
{
    return sqrt(k*(1.0 + tau*k*k));
}

float gamma_star(float k)
{
    float k_star = k/R_star;
    float omega_star = omega(k)*sqrt(GRAV/R_star);
    return 0.5*sqrt((omega_star*V_star)/(2.0))*k_star + 2.0*V_star*k_star*k_star;
}
//wave damping (sensitive)
float Damping(float k, float t_star) 
{
   return exp(-gamma_star(k)*t_star);
}

float A(float k, float t_star)
{
   return (omega(k)*Damping(k,t_star)*sqrt(k))/sqrt(abs(dV(k)));
}
//calculate wave hight at this radius and wave time
float height(float r_star, float t_star)
{
    float r = r_star/R_star;
    float t = t_star * sqrt(GRAV/R_star);
    if ((r/t) < V_MIN || (r/t) > V_MAX)
    {
        return 0.0;
    }
    float vamp = (3.0*(10.0/sqrt(GRAV*R_star)))/(128.0*sqrt(r*t));
    vec2 ks = WaveNumbers(r/t);
    float k0 = ks[0];
    float k1 = ks[1];
    float wave0 = A(k0,t_star)*sin(omega(k0)*t - k0*r); 
    float wave1 = A(k1,t_star)*cos(omega(k1)*t - k1*r);

    return vamp*(wave0 + wave1);
}

//store the additive wave heights in a height map.
void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    float wave_height = 0.0;
    int ripple_index = 0;
    while (ripple_index < 10)
    {
    	vec4 ripple = texelFetch(iChannel1, ivec2(ripple_index,0),0);
        float t_star = ripple.b;
        float r_star = length(ripple.rg - (fragCoord.xy/float(iResolution.xy)))*4.0;
        wave_height += height(r_star,t_star);
        ripple_index += 1;
    }

    fragColor = vec4(1000.0*wave_height,0.0,0.0,1.0);//store height in r channel
}
